import React,{useState,useEffect} from 'react';
import { Link,Navigate } from 'react-router-dom';
import axios from 'axios';

const Myprofile = () => {
    const [data,setData]=useState(null);
    const [review,setReview] = useState([]);
    useEffect(()=>{
       axios.get('http://localhost:5000/Myprofile',{
        headers : {
            'x-token' : localStorage.getItem('token')
        }
       }).then(res => setData(res.data))
       axios.get('http://localhost:5000/Myreview',{
        headers : {
            'x-token' : localStorage.getItem('token')
        }
       }).then(res => setReview(res.data))
    },[])
    if(!localStorage.getItem('token')){
        return <Navigate to="/Login" replace={true} />
    }
    return (
        <div>
            <nav calssName="navbar bg-dark">
                <h1>
                    <Link to="/"><i className="fas fa-code"></i>Developers Hub</Link>
                </h1>
                <ul>
                    <li><Link to="/Myprofile">My Profile</Link></li>
                    <li><Link to="/Login">LogOut</Link></li>
                </ul>
            </nav>
            {data && 
              <section calssName="container">
              <Link to="/Myprofile" calssName="btn btn-light">Back to Profiles</Link>
              <div calssName="profile-grid my-1">
                  <div calssName="profile-top bg-primary p-2">
                      <img calssName="round-img my-1" src="" alt="" />
                      <h1 calssName="large" >{data.name}</h1>
                      <p calssName="lead">{data.email}</p>
                      <p>India</p>
                  </div>
                  <div className="profile-github">
                      <h2 calssName="text-primary my-1">
                          <i calssName="fab fa-github"></i>Reviews And Ratings
                      </h2>
                      <div calssName="repo bg-white p-1 my-1">
                          <div>
                              <h4><Link to="#">John</Link></h4>
                              <p>
                                  4/5
                              </p>
                          </div>
                      </div>
                      <div calssName="repo bg-white p-1 my-1">
                          <div>
                              <h4>Enter Your Reviews</h4>
                              <form calssName="form" autoComplete="off">
                                  <div calssName="form-group">
                                      <input type="text" placeholder="Enter Your Rating out of 5" name="rating" required />
                                  </div>
                                  <input type="submit" calssName="btn btn-primary" value="Add Rating" />
                              </form>
                          </div>
                      </div>
                  </div>
              </div>
          </section>
            }
            
        </div>
    )
}
export default  Myprofile
